import React from 'react';
import styled from 'styled-components';

const  ButtonStyle = styled.div`
    display: flex;
    align-items: center;
    border: 1px solid black;
    border-radius: 50px;
    width: 200px;
    padding: 15px 30px;
    margin: 10px auto;
    `
const ButtoonImageStyle = styled.img`
    width: 30px;
    margin-right: 10px;
`

function ImagemButton(props) {
    return (
        <ButtonStyle className="image-button-container">
            <ButtoonImageStyle src={ props.imagem }/>
            <p>{ props.texto }</p>
        </ButtonStyle>

    )
}

export default ImagemButton;
